import React from 'react'
import Card from '../commons/Card';

const Content = ({popMovies}) => {
  return(
    <div className="content">
    {popMovies.map((movie)=>{
      console.log(movie);
    <div key={movie.id}> 
    <Card mov={movie}/>
    </div>
    })}
    </div>
  )
}

export default Content
